  };

  moveToNull = (index) => {
    let tracker = 14;
    const blocks = this.state.blocks;
    if (index === tracker) {
      alert("You can't move this block");
      console.log("works");
    }
    // blocks[index].key = 1123790;
    this.setState({
      blocks,
    });
  };

  render() {
    return (
      <div>
        <DivBlock blocks={this.state.blocks} moveToNull={this.moveToNull} />
      </div>
    );
  }
}

export default App;
